import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
container:{
height:230,
width:'100%',
alignItems:"center",
backgroundColor:"white",
justifyContent:"center"
},
    TextLogo:{
color:"#74797B",
fontSize:120,
fontWeight:"bold"

    },
    text:{

        color:"#74797B",
        fontSize:30,
        fontWeight:"bold",
        position:'absolute',
        bottom:45

    }
});

export default styles;
